import styled from "styled-components";

import Header from "../Header";

const StyledOnline = styled.div`
  width: 100%;
`;



const Online = ({}) => {
  return (
    <StyledOnline>
      <Header>
            <p
          style={{
            fontSize: "16px",
            fontWeight: 700,
            letterSpacing: "2px",
            marginLeft: "22px",
          }}
        >
          ACTIVE GAMES (4)
        </p>lineP>
      </Header>
    </StyledOnline>
  );
};

export default Online;
